DASHV4-165
• Починить показ и отправку dropoff и pickup на сервер;
• Сделать вывод ошибок на полях модели и связях;• Добавить галку «Additional Stop», если один из адресов является аэропортом;
• Выводить не всевозможные в системе события с пустыми значениями, а уже существующие события у заказа + вероятные события (ТРЕБУЕТ ОБСУЖДЕНИЯ);
• В случае со статусом done требуется редактировать real_dropoff или просто dropoff (ВОПРОС).
